import {WordTemplateArgument} from "./args/WordTemplateArgument.js"
import {RawTemplateArgument} from "./args/RawTemplateArgument.js"
import {JsTemplateArgument} from "./args/JsTemplateArgument.js"
import {IntTemplateArgument} from "./args/IntTemplateArgument.js"
import {FloatTemplateArgument} from "./args/FloatTemplateArgument.js"
import {BlockTemplateArgument} from "./args/BlockTemplateArgument.js"
import {Register} from "../genes/Register.js"

const $global = Register.$global

export const TemplateRegisterer = Register.global("$hxClasses")["mcl.TemplateRegisterer"] = 
class TemplateRegisterer {
	static register() {
		RawTemplateArgument.register();
		IntTemplateArgument.register();
		JsTemplateArgument.register();
		BlockTemplateArgument.register();
		FloatTemplateArgument.register();
		WordTemplateArgument.register();
	}
	static get __name__() {
		return "mcl.TemplateRegisterer"
	}
	get __class__() {
		return TemplateRegisterer
	}
}

